import React from 'react';
import './App.css';

function App() {
  const [images, setImages] = React.useState([]);

  React.useEffect(() => {
    setImages(['2', '10', '20', '25'])
  }, [])

  return (
    <div className='container'>
      <div className='row justify-content-center mt-2'>Images</div>
      <div className='mt-5'>{images.map(image => <div className='row'><div className='col-2'>{image}</div></div>)}</div>
    </div>
  );
}

export default App;
